import React from "react";

const FollowerCard = props => {
  return (
    <div className="user-card">
      <img 
        src={props.src} 
        width="30%" 
        alt="My Avatar">
      </img>
      <h1>{props.name}</h1>
      <p> Total Followers: {props.followers_url}</p>
      <p>Total Repos: {props.repoNum}</p>
      <p> Location: {props.location}</p>
      key={props.id}
      name={props.login}
      src={props.avatar_url}
      github={props.html_url}
      files={props.repos_url}
    </div>
  )
}
export default FollowerCard;
